export default (function(a,b,c,d){return {data:{UwjotOqCa7:{data:{id:2664,attributes:{imdbId:"tt0108388",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTkzMzk4OTI2N15BMl5BanBnXkFtZTYwMTA1Mjg4._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"29%"}],item_lang:{data:{id:3327,attributes:{title:c,plot:"Joseph K. (Kyle MacLachlan) awakens one morning to find two strange men in his room, telling him he has been arrested. Joseph is not told with what he is charged, and despite being \"arrested\" is allowed to remain free and go to work. But, despite the strange nature of his arrest, Joseph soon learns that his trial, however odd, is very real, and he tries desperately to spare himself from the court's judgement.",slug:"the-trial"}}},books:{data:[{id:12745,attributes:{title:c,description:"The Trial is one of the central works of modern literature. This meticulous new translation includes the chapters Kafka left incomplete and is accompanied by a biographical preface, detailed introduction, chronology, bibliography and notes.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=M2936BxlxqEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2009-07-09",publisher:"Oxford University Press",subtitle:a}},{id:12746,attributes:{title:"The Trial - Franz Kafka",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=t0YxEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2021-01-01",publisher:a,subtitle:a}},{id:12747,attributes:{title:c,description:"Narrates the experiences and reactions of a respectable bank functionary after his abrupt arrest on an undisclosed charge",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8T9_cxH7z6sC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Willa Muir"],firstBook:d,published:"1992-01-01",publisher:"Everyman's Library",subtitle:a}},{id:12748,attributes:{title:c,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JWYGAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1963-01-01",publisher:a,subtitle:a}},{id:12749,attributes:{title:"The Trial - A Dramatic Monologue",description:"Somebody must have maligned Joseph K. because he was arrested one morning without having done anything wrong. Franz Kafka's novel translated and adapted for the stage for solo performance.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3Z6BjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Howard Colyer"],firstBook:d,published:"2016-02-01",publisher:"Lulu.com",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940903718}}("","Franz Kafka","The Trial",null))